প্লিজ কেউ আমাকে ধরো।বুলবুলি শুনে এটা শুনতে আসছিলাম। ওহ কি গান এতো হার্ট টাচিং। বাংলাদেশ আই লাভ ইউ ❤❤❤।
এখন বাজে রাতের ৩টা আর আমি হেডফোনে এই গান গুলো শুনছি এতো যে ভালো  লাগছে।এই নিয়ে ৬ বার একটানা শুনছি কিন্তু একটুও বোরিং লাগছেনা। ওয়ারফেজ ❤❤
